import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import Login from "./Component/Login";
import Homepage from "./Component/Homepage"

export const routes = [
  {
    path: "/",
    exact: true,
    component: Homepage
  },
  {
    path: "/login",
    exact: true,
    component: Login
  },
  {
    path: "/register",
    exact: true,
    component: Login
  },
  {
    path: "/forgotPassword",
    exact: true,
    component: Login
  },
  {
    path: "/resetPassword",
    exact: true,
    component: Login
  },
  {
    path: "/dashboard",
    name: "Dashboard",
    component: Login,
    icon: "dashboard",
    nav: true
  },
  {
    path: "/excel",
    name: "Excel",
    component: Login,
    icon: "file-excel",
    nav: true,
    subPage: [
      {
        path: "/upload",
        name: "Upload",
        component: Login,
        icon: "file-excel",
      },
      {
        path: "/histories",
        name: "Histories",
        component: Login,
        icon: "book"
      },
  
    ]
  },
  {
    path: "/transfer",
    name: "Transfer",
    component: Login,
    icon: "dollar",
    nav: true
  },
  {
    path: "/campaign",
    name: "Campaign",
    icon: "star",
    nav: true,
    subPage: [
      {
        path: "/manager",
        name: "Management",
        component: Login,
        icon: "audit"
      },
      {
        path: "/badges",
        name: "Badge Images",
        component: Login,
        icon: "picture"
      }
    ]
  },
  {
    path: "/user",
    name: "User",
    icon: "user",
    nav: true,
    subPage: [
      {
        path: "/approval",
        name: "User Approval",
        component: Login,
        icon: "audit"
      },
      {
        path: "/approvalProfile",
        name: "Approval Profile",
        component: Login,
        icon: "audit"
      },
      {
        path: "/management",
        name: "User Management",
        component: Login,
        icon: "user"
      },
    ],
  },
  {
    path: "/admin",
    name: "Admin",
    icon: "crown",
    nav: true,
    subPage: [
      {
        path: "/management",
        name: "Admin Management",
        component: Login,
        icon: "user"
      },
      
    ],
  },
  {
    path: "/invitation",
    name: "Invitation",
    icon: "user-add",
    nav: true,
    subPage: [
      {
        path: '/invitation',
        name: 'Send Invitation',
        component: Login,
        icon: 'user-add',
      },
      {
        path: '/invited',
        name: 'Invited User',
        component: Login,
        icon: 'user-add',
      },
    ]
  },
  {
    path: "/configs",
    name: "Configs",
    icon: "setting",
    nav: true,
    subPage: [
      {
        path: "/financeamount",
        name: "Contract Bonus",
        component: Login,
        icon: "red-envelope"
      },
      {
        path: "/contractType",
        name: "Contract Type",
        component: Login,
        icon: "inbox"
      },
      {
        path: "/dealership",
        name: "Dealership",
        component: Login,
        icon: "team"
      },
      {
        path: "/point",
        name: "Point",
        component: Login,
        icon: "pay-circle"
      },
      {
        path: "/pointmatrix",
        name: "Point Matrix",
        component: Login,
        icon: "audit"
      },
      {
        path: "/producttypebonus",
        name: "Product Bonus",
        component: Login,
        icon: "pay-circle"
      },
      {
        path: "/productconfiguration",
        name: "Product Config",
        component: Login,
        icon: "pay-circle"
      },
      {
        path: "/product",
        name: "Product Type",
        component: Login,
        icon: "inbox"
      },
      {
        path: "/rank",
        name: "Rank",
        component: Login,
        icon: "star"
      },
    ]
  },
  {
    path: "/account",
    name: "Account",
    icon: "user",
    nav: true,
    subPage: [
      {
        path: "/changePassword",
        name: "Change Password",
        component: Login,
        icon: "user"
      }, {
        path: "/logout",
        name: "Logout",
        component: Login,
        icon: "logout",
        nav: true
      }
    ],
  },
  {
    path: "/Report",
    name: "Report",
    icon: "read",
    nav: true,
    subPage: [
      {
        path: "/Row_Point",
        name: "RowPoint",
        component: Login,
        icon: "user"
      }, {
        path: "/Transaction",
        name: "Transaction",
        component: Login,
        icon: "money-collect",
        nav: true
      },
      {
        path: "/User_Access",
        name: "User Access",
        component: Login,
        icon: "user",
        nav: true
      }
    ],
  }
];

export const AppRouter = props => {
  return (
    <Router>
      <Switch>
        {routes.map((route, i) =>
          route.subPage ? (
            route.subPage.map((sub, j) => (
              <Route
                key={`${i}_${j}`}
                {...sub}
                path={`${route.path}${sub.path}`}
              />
            ))
          ) : (
            <Route key={i} {...route} />
          )
        )}
      </Switch>
    </Router>
  );
};
